import axios from "axios";
import { useEffect, useState } from "react";

function Blog(){

const [getdata,setData]= useState([]);
useEffect(()=>{
    axios.get("http://localhost/laravel8/laravel8/public/api/blog")
    .then(demo =>{
        setData(demo.data.blog)
        console.log(getdata)
    })
    .catch(function (error) {
        console.log(error)
    })
},[])


function renderData(){
    if(Object.keys(getdata).length > 0){
        return getdata.data.map((value, key)=>{
            <li key={key}>
                <p>{value.id}</p>

            </li>

        })
    }

}
    return (
       <div>{renderData}</div>
			                 
    )
		
}
export default Blog;
